/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_attendance`(`user_id` BIGINT, `checktime` DATETIME, `checktype` VARCHAR(10))
BEGIN
		declare employee_id BIGINT;
		DECLARE var_out_time datetime;
		DECLARE var_id bigint;
		DECLARE var_exists bigint;
		
		SELECT id INTO employee_id FROM employees WHERE acu_id = user_id;
		IF checktype = "O" THEN
		SELECT a.id,a.out_time INTO var_id,var_out_time FROM attendance a WHERE DATE(in_time)=DATE(checktime) AND employees_id=employee_id ORDER BY in_time DESC LIMIT 1;
			if (var_out_time < checktime) THEN
				UPDATE attendance SET out_time = checktime WHERE id = var_id;
			END IF;
		ELSE
			SELECT COUNT(id) INTO var_exists FROM attendance WHERE employees_id= employee_id AND in_time = checktime;
			IF var_exists = 0 THEN
			END IF;
		END IF;
		SELECT 'good';
	END */$$
