/* Procedure structure for procedure `refresh_leaves` */

/*!50003 DROP PROCEDURE IF EXISTS  `refresh_leaves` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `refresh_leaves`()
BEGIN
 DECLARE done INT DEFAULT FALSE;
 DECLARE done1 INT DEFAULT FALSE;
  DECLARE a INT;
  DECLARE b CHAR(16);
  DECLARE c,d CHAR(16);
  DECLARE cur1 CURSOR FOR SELECT pg.payroll_group_id FROM payroll_groups pg WHERE pg.is_deleted=0;
	
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE, done1=TRUE;
  SELECT EXTRACT(YEAR FROM NOW()) INTO b;
  SELECT NOW() INTO c;
  
  OPEN cur1;
  read_loop: LOOP
    FETCH cur1 INTO a;
    IF done THEN
      LEAVE read_loop;
    END IF;
      VALUES (CONCAT("L",a,b),a,b-1,c,1);
      SELECT LAST_INSERT_ID() INTO d;
    
	SELECT d,eal.employee_id,eal.leave_id,IF (eal.total_leave>5,5,total_leave) AS remaining_leave,e.basic_salary/ps.days_per_month,(e.basic_salary/ps.days_per_month)*IF (eal.total_leave>5,5,total_leave)
	FROM employees_available_leaves eal JOIN LEAVES l ON eal.leave_id=l.id JOIN employees e ON eal.employee_id=e.id JOIN payroll_settings ps ON e.payroll_group_id=ps.pay_group_id 
	WHERE l.is_convertable=1 AND eal.is_converted=0 AND e.payroll_group_id=a AND eal.is_deleted=0;
	
	UPDATE employees_available_leaves eal JOIN leave_conversion_details lcd ON eal.employee_id=lcd.employee_id JOIN leave_conversion lc ON lcd.leave_conversion_id=lc.id
	SET eal.is_converted=1 WHERE eal.is_deleted=0;
	
  END LOOP read_loop;
	
	SELECT eal.leave_id,eal.employee_id,balance_per_year,CURDATE(),balance_per_year
	FROM employees_available_leaves eal
	WHERE eal.is_deleted=0;
	
